import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

// Components
import AppNavbar from './components/AppNavbar';
import Home from './components/Home';
import TestConnection from './components/TestConnection';
import CityKpiList from './components/CityKpiList';
import HighestPollution from './components/HighestPollution';

function App() {
  return (
    <Router>
      <div className="App">
        <AppNavbar />
        <main className="py-3">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/test-connection" element={<TestConnection />} />
            <Route path="/city-kpis" element={<CityKpiList />} />
            <Route path="/highest-pollution" element={<HighestPollution />} />
          </Routes>
        </main>
        <footer className="bg-dark text-white text-center py-3 mt-5">
          <div className="container">
            <p className="mb-0">SmartCity KPI Dashboard &copy; {new Date().getFullYear()}</p>
          </div>
        </footer>
      </div>
    </Router>
  );
}

export default App;
